    if (isInsert == true) {
      id = null;
    }
  }

  /// saveAll method saves the sent List<Operation> as a bulk in one transaction
  /// Returns a <List<BoolResult>>
  static Future<List<dynamic>> saveAll(List<Operation> operations) async {
    List<dynamic>? result = [];
    // If there is no open transaction, start one
    final isStartedBatch = await FamilyBudget().batchStart();
    for (final obj in operations) {
      await obj.save(ignoreBatch: false);
    }
    if (!isStartedBatch) {
      result = await FamilyBudget().batchCommit();
      for (int i = 0; i < operations.length; i++) {
        if (operations[i].id == null) {
          operations[i].id = result![i] as int;
        }
      }
    }
    return result!;
  }

  /// Updates if the record exists, otherwise adds a new row
  /// <returns>Returns id
  @override
  Future<int?> upsert({bool ignoreBatch = true}) async {
    try {
      final result = await _mnOperation.rawInsert(
          'INSERT OR REPLACE INTO operation (id, status, date_modify, user_id, type, category_id, date, description, value)  VALUES (?,?,?,?,?,?,?,?,?)',
          [
            id,
            status,
            date_modify,
            user_id,
            type,
            category_id,
            date,
            description,
            value
          ],
          ignoreBatch);
      if (result! > 0) {
        saveResult = BoolResult(
            success: true,
            successMessage: 'Operation id=$id updated successfully');
      } else {
        saveResult = BoolResult(
            success: false, errorMessage: 'Operation id=$id did not update');
      }
      return id;
    } catch (e) {
      saveResult = BoolResult(
          success: false,
          errorMessage: 'Operation Save failed. Error: ${e.toString()}');
      return null;
    }
  }

