          [id, status, date_modify, user_id, message, date, message_status],
          ignoreBatch);
      if (result! > 0) {
        saveResult = BoolResult(
            success: true, successMessage: 'Chat id=$id updated successfully');
      } else {
        saveResult = BoolResult(
            success: false, errorMessage: 'Chat id=$id did not update');
      }
      return id;
    } catch (e) {
